import React from 'react';
import LikeButton from '../../Components/LikeButton/LikeButton';
import arrowDownYellow from '../../Asset/Images/arrow_down_yellow.png'
import './Homepage.scss';

const typeJokes = [
  {
    code:'adult',
    title:'Adult Jokes',
    color: '#ff5b5b'
  },
  {
    code:'dad',
    title:'Dad Jokes',
    color: '#ff915b'
  },
  {
    code:'christmas',
    title:'Christmas Jokes',
    color: '#ffbe5b'
  },
  {
    code:'job',
    title:'Job Jokes',
    color: '#ffdf5b'
  },
  {
    code:'birthday',
    title:'Birthday Jokes',
    color: '#8fe360'
  },
  {
    code:'social',
    title:'Social Jokes',
    color: '#57e690'
  },
  {
    code:'pun',
    title:'Puns',
    color: '#57dbe6'
  },
  {
    code:'all',
    title:'View all',
    color: '',
  }
]

const Homepage = () => {
  return (
    <div className="homepage">      
      <div className='container'>
        <div className='homepage__tab'>
          {
            typeJokes.map((element,index)=>(
              <div key={index} className={element.code!=='all'?'tab__item': 'tab__item view-all'} style={{backgroundColor: `${element.color}`}}>
                {element.title}
                {
                  element.code==='all' && <div>
                    <img src={arrowDownYellow} alt='images' />
                  </div>
                }
              </div>
            ))
          }
        </div>
      </div>
    </div>
  );
}

export default Homepage;
